import React, { useState } from 'react';
import {
  Box,
  Button,
  Textarea,
  VStack,
  useToast,
  Code,
  Text,
  Table,
  Thead,
  Tbody,
  Tr,
  Th,
  Td,
  TableContainer,
  Heading,
  CircularProgress,
} from '@chakra-ui/react';

interface ConnectionConfig {
  secureConnectBundle: string;
  keyspace: string;
  token: string;
  dbUUID: string;
  region: string;
  connectionMethod: 'driver' | 'cqlsh';
  driverType?: 'python' | 'java';
}

interface QueryInterfaceProps {
  config: ConnectionConfig;
}

interface QueryResult {
  columns?: { name: string; type_code: number; type_info: any }[];
  rows?: any[][];
  error?: string;
  execution_time?: number;
}

const QueryInterface: React.FC<QueryInterfaceProps> = ({ config }) => {
  const [query, setQuery] = useState('');
  const [results, setResults] = useState<QueryResult | null>(null);
  const [isLoading, setIsLoading] = useState(false);
  const toast = useToast();

  const handleSubmit = async () => {
    if (!query.trim()) {
      toast({ title: 'Query cannot be empty', status: 'warning', duration: 3000, isClosable: true });
      return;
    }
    setIsLoading(true);
    setResults(null);

    const backendPayload = {
      query: query,
      config: {
        database_id: config.dbUUID,
        token: config.token,
        keyspace: config.keyspace,
        region: config.region,
        secure_bundle: config.secureConnectBundle
      },
      mode: {
        mode: config.connectionMethod,
        driver_type: config.connectionMethod === 'driver' ? config.driverType : undefined
      }
    };

    try {
      const response = await fetch('/api/execute-query', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(backendPayload),
      });

      const data: QueryResult = await response.json();

      if (!response.ok) {
        throw new Error(data.error || 'Failed to execute query');
      }
      setResults(data);
      toast({ title: 'Query executed successfully!', status: 'success', duration: 3000, isClosable: true });
    } catch (error: any) {
      const errorMessage = error.message || 'An unexpected error occurred.';
      setResults({ error: errorMessage });
      toast({ title: 'Error executing query', description: errorMessage, status: 'error', duration: 5000, isClosable: true });
    }
    setIsLoading(false);
  };

  return (
    <Box p={5} shadow="md" borderWidth="1px" borderRadius="md" w={"100%"} maxW={"800px"}>
      <Heading size="md" mb={4}>Execute CQL Query</Heading>
      <VStack spacing={4} align="stretch">
        <Textarea
          placeholder="Enter your CQL query here (e.g., SELECT * FROM table_name)"
          value={query}
          onChange={(e) => setQuery(e.target.value)}
          rows={5}
        />
        <Button colorScheme="teal" onClick={handleSubmit} isLoading={isLoading}>
          Execute Query
        </Button>
      </VStack>

      {isLoading && <CircularProgress isIndeterminate color="teal.300" my={4} />}

      {results && (
        <Box mt={6}>
          <Heading size="sm" mb={3}>Query Results</Heading>
          {results.error && (
            <Code colorScheme="red" p={3} borderRadius="md">
              Error: {results.error}
            </Code>
          )}
          {results.execution_time !== undefined && (
            <Text fontSize="sm" color="gray.500" mb={2}>
              Execution time: {results.execution_time.toFixed(4)} ms
            </Text>
          )}
          {results.columns && results.rows && results.rows.length > 0 && (
            <TableContainer>
              <Table variant="striped" size="sm">
                <Thead>
                  <Tr>
                    {results.columns.map((col) => (
                      <Th key={col.name}>{col.name}</Th>
                    ))}
                  </Tr>
                </Thead>
                <Tbody>
                  {results.rows.map((row, rowIndex) => (
                    <Tr key={rowIndex}>
                      {row.map((cell, cellIndex) => (
                        <Td key={cellIndex}>{typeof cell === 'object' ? JSON.stringify(cell) : String(cell)}</Td>
                      ))}
                    </Tr>
                  ))}
                </Tbody>
              </Table>
            </TableContainer>
          )}
          {results.rows && results.rows.length === 0 && (
            <Text>No rows returned.</Text>
          )}
        </Box>
      )}
    </Box>
  );
};

export default QueryInterface;
